Description. Adult (
Figs. 7−9
): Wingspan 9.2−12.4 mm . Head white mixed with gray and brown. Thorax white mixed with gray. Antennae brown, 2 / 3 length of forewing, each flagellomere with basal row of scales dark brown and apical row gray. Labial palpi with outer side of second segment dark brown with white annuli at 2 / 3 length and at apex, inner side white; third segment white with two dark brown annuli. Forewing dark gray to brown, subbasal fascia dark brown, with dark brown median spot at base; costa with three dark brown spots, one near base, one on 1 / 3 length, one on 2 / 3 length; a dark brown median streak beyond discal cell, surrounded by brown; terminal area with black median streak beyond discal cell; dorsum with dark brown spot at 2 / 3 length. Hindwing light gray or brown with silvery brown or gray fringe, male with yellowish orange sex scales on anal margin from base to CuA 2 , on cubital vein from near base to margin, and on costal margin.
